import React from 'react';
import Nav from '../components/Nav';
import '../css/nav.css';
import '../css/login.css';


const Login = () => {
    return (
        <div>
            <Nav />
          <div className="box">
              <article>
                  <input type="email" placeholder='adress@mail.com' />
              </article>
          </div>
        </div>
    );
};

export default Login;
